import CostDate from "./CostDate";

export default function CostItem(props){

    const title = props.data.title;
    const date = props.data.date;
    const cost = props.data.cost;

    return (
        <>
            <CostDate date={date} />
            <div>
                <div>{cost}</div>
                <div>{title}</div>
            </div>
        </>
    )
}
